1. Background
Urban Video Game Academy (UVGA) is a seven-year old project-based afterschool tech literacy and skills program design to promote STEM literacy and learning through the video game development process.  UVGA and its board of advisors and program partners also help serve as a clearinghouse for the development of college and university scholarship opportunities through  video game industry design competition events and their sponsor support.  

BLAXCOM Solutions, LLC manages and operates the UVGA as a for-profit program that provides an after-school technology solutions to the need for computer-based curriculums that utilizes the video game development process to engage and teach students for 21st century skills mastery.

2. Mission and Objectives
The mission of the Urban Video Game Academy (UVGA) is to better prepare students in disadvantaged areas for post-secondary education and technology careers by teaching them the fundamentals of video game design and development. Our mission has three basic components:  to expose dis-advantaged students to career opportunities in video game design and development, to educate them in how to create games, and to enhance their learning in math, science, reading, and writing, which are all important features of the video game development process.

UVGA uses video game design and development to accomplish the following objectives:

1. To better prepare disadvantaged youth for college-level study in video game design and related fields such as computer science, digital art and engineering;

2. To enhance learning in math, science, reading, and writing through their applications in the video game development process;

3. To excite and inform disadvantaged youth about career alternatives in the video game design industry and related fields such as computer science, digital art and engineering;

4. To instill in disadvantaged youth a positive self image and teach them teamwork, leadership skills, and positive social interaction and communication skills;

5. To provide after-school and weekend classes that will keep disadvantaged youth engaged in productive activities;

6. To encourage related businesses and public organizations to support these efforts.

The UVGA program reaches students from elementary to high school students in the Baltimore-DC area.  The schools curriculum feature introductory graphic design software and computer programming, along with math enrichment.  Most of the software utilize by the program can be obtained and installed with a no-fee-license.  Software examples are: MS Power Point, MS Paint, ALICE 2.0, and Game Maker 8.1 Other software such as, Adobe Creative Suite 6 (CS6) which can include Photoshop, Illustrator, In-design, and FLASH).  Other application curriculums include Scalextric4Schools (uses PTC Creo CAD) Autodesk Maya, 3D Max, Blender, and Zbrush for 3D modeling sculpting and animation rigging.

We offer 6 courses - 1 yearlong course (AP) and 5 trimester-long:
* Intro to computer science ( teaches Scratch, Python, VPython programming);
* Intro to computer science - website design (teaches HTML, CSS, Javascript);  
* Intro to discrete mathematics and programming (hybrid  course, teaches Python);
* AP computer science - prepares for the College Board AP exam (teaches Java, yearlong, no CS prereqs);
* Data structures (Java, post-AP, 4-hours per week)
* Advanced website design - Rails version (teaches Ruby, Rails platform, SQL, 4-hours per week)
* After-school club for students who want to do more (contests, App Inventor for Android, Finch robots)
